(154, 'en', 'node_search', ' la villa florentine la villa florentine admin fri 1192018 1222 5 la villa florentine hotel relais chateaux 5 etoiles vous accueille a lyon pour un sejour d exception au coeur d un veritable havre de paix idealement situe sur les hauteurs de la colline de fourviere le relais chateaux villa florentine vous offre un fantastique panorama sur lyon et le quartier historique du vieux lyon classe au patrimoine mondial de l unesco country design ', 0),
(155, 'en', 'node_search', ' hotel du palais hotel du palais admin fri 1192018 1224 5 grace a ses infrastructures de luxe et ses installations a la pointe de la technologie l hotel du palais s apparente parfaitement a un second chez soi surplombant la grand plage cette piscine d eau salee de style californien chauffee a 27 c est comme une extension naturelle de l ocean atlantique elle dispose de deux couloirs de nage de 33 metres cabanas disponibles sur reservation la terrasse de la piscine est ideale pour prendre un bain de soleil ou savourer un cocktail en admirant le coucher de soleil sur la mer ouvert d avril a septembre country ', 0),
(156, 'en', 'node_search', ' le meurice le meurice admin fri 1192018 1225 5 idealement situe face au jardin des tuileries entre la place de la concorde et le musee du louvre le meurice hotel cinq etoiles s impose depuis 1835 comme etant le joyau des palaces francais fidele a ses valeurs d art de vivre a la francaise le meurice est un lieu magique calme et elegant ou se croisent en douceur les splendeurs de l architecture du xviiie et le raffinement du confort le plus contemporain de nombreux artistes peintres et ecrivains ont marque l histoire du meurice qui a ete et sera toujours un lieu d expression du genie francais et de l art de vivre les sept etages possedent leurs propres univers avec 160 chambres decorees dans un style evoquant l epoque de louis xvi chacune equipee d une superbe salle de bains en marbre avec baignoire et douche separees en 2007 les espaces d accueil du meurice ont ete redecores par philippe starck il a su apporter une touche de modernite et un chic contemporain tout en preservant l atmosphere d ecrin de luxe liee a l ame de l etablissement le restaurant gastronomique le meurice 3 etoiles michelin propose des menus a la fois audacieux et modestes elevant au rang des beaux arts la gastronomie parisienne et cree pour le restaurant le dali un nouveau concept culinaire et tisse ainsi un lien delicieux et malicieux entre le passe et le present vous aurez ainsi une petite pensee pour salvador dali qui fut l un des hotes celebres du meurice en plein cœur de paris a deux pas de la place vendome et de la rue sainthonore ou foisonnent les boutiques de luxe et celles des jeunes createurs le meurice se laisse decouvrir comme un veritable havre de paix ou il fait bon d etre soimeme le meurice alain ducasse city design ', 0),
(157, 'en', 'node_search', ' hotel de seze hotel de seze admin fri 1192018 1226 4 chic et contemporain l hotel de seze entierement renove et redecore vous ouvre ses portes cette belle maison parisienne elegante et raffinee est remarquablement situee place de la madeleine au carrefour des 9eme et 8eme arrondissements de paris a deux pas des tres chics enseignes fauchon hediard dior chanel laduree etc ses chambres et suites dans l inattendu de leurs details vous inviteront a un sejour d authentique raffinement un lieu de quietude ou l on se sent chez soi grace au soin prevenant d une hotellerie de style une situation exceptionnelle pour un hotel d exception  city ', 0),
(158, 'en', 'node_search', ' hotel albert 1er hotel albert 1er admin fri 1192018 1227 3 hotel 3 etoiles alliant confort et tradition a toulouse l albert 1er est situe a 100 metres du capitole dans le centre historique au sein d une une petite rue calme qui a abrite les ateliers du peintre pierre rivals grande famille de peintres toulousains du xvie siecle l hotel albert 1er est un hotel independant et familial idealement place sur la via tolosana l un des chemins de saintjacques de compostelle passant par toulouse l hotel albert 1er est le point de depart privilegie pour decouvrir ou de redecouvrir les charmes de la ville rose et de la region midipyrenees country charme ', 0),
(160, 'en', 'node_search', ' epicure epicure admin fri 1192018 1358 le restaurant gastronomique 3 etoiles au guide michelin a elu residence cote jardin epicure ouvre ses baies vitrees sur le magnifique jardin a la francaise de l hotel l architecte pierreyves rochon en collaboration avec madame maja oetker a transfigure l ancien restaurant d ete en un ecrin precieux inonde de lumiere dedie a l art de vivre et au plaisir de deguster la cuisine du chef eric frechon epicure est ouvert tous les jours pour le petit dejeuner le dejeuner et le diner le bristol ', 0);
