(161, 'en', 'node_search', ' flocon de sel flocon de sel admin fri 1192018 1401 intimite raffinement etudie dans les moindres details authenticite d un art de vivre en montagne porte a sa perfection notre restaurant gastronomique offre un cadre unique pour un diner romantique un dejeuner convivial entre amis ou un repas de famille omble chevalier juste cuit sabayon the vert et pommes ceramiques a sa table proche des cimes le chef emmanuel renaut livre une cuisine aussi subtile qu inventive que vous pourrez accorder a de riches nectars a decouvrir parmi les nombreuses references de notre carte des vins le restaurant gastronomique flocons de sel est ferme tous les mardis et mercredis  ', 0),
(162, 'en', 'node_search', ' le jardin des sens le jardin des sens admin fri 1192018 1403 un cube de verre dans un jardin aux essences mediterraneennes un lieu lumineux concu en amphitheatre jouant sur l espace entre les tables les plafonds hauts l ouverture sur le jardin et le bassin aux lignes pures ou se melent art contemporain et cuisine creative a quatre mains esprit du sud dans un environnement urbain chic cree par les jumeaux jacques laurent pourcel chefs etoiles et agitateurs de sens dedans dehors sous le soleil ou sous la lune ici le luxe c est l espace variation vegetale au fil des saisons lumiere naturelle le temps s arrete le temps d un repas exaltation des sens dans la decouverte de l essentiel moderne mais confortable ce lieu hors du temps vous etonnera par sa conception et son design aux portes de la ville il vous permettra d acceder au centre ville rapidement  ', 0),
(163, 'en', 'node_search', ' le meurice alain ducasse le meurice alain ducasse admin fri 1192018 1404 une cuisine presque brute qui fait du bon avec du simple le gout est restitue dans sa verite sans ingredient superflu les preparations s epurent pour laisser toute sa place a la force du gout le retour a l essentiel c est aussi respecter le rythme des saisons lorsque le produit est le meilleur pour alain ducasse le repas raconte une histoire la table est une scene une nouvelle vaisselle trouve sa place au restaurant le meurice de rares objets de table donnent le rythme des creations originales signees pierre tachon ou de precieuses pieces d artisanat japonais de shinichiro ogata inspiree du salon de la paix du chateau de versailles la salle s impose majestueusement les miroirs anciens les lustres en cristal les bronzes les marbres les fresques une elegance romantique un decor raffine hors du temps sans oublier la vue magique qui se dessine a travers de larges fenetres sur le jardin des tuileries voisin la decoration du restaurant a ete revisitee par philippe starck en 2007 le meurice ', 0);
